function getBarcodePromise(text) {
    return new Promise((resolve, reject) => {

        bwipjs.toBuffer({ bcid: 'code128', text: text }, function (err, png) {
            if (err) {
                reject(err);
            } else {
                resolve(`data:image/png;base64,${png.toString('base64')}`);
            }
        });
    })
}

